import React from "react";

import Points from "./Points";

import "./Features.css";

import pixel from "../../assets/pixel.png";

const Features = () => {
  return (
    <div id="features">
      <img src={pixel} alt="pixel" className="pixel" />
      <h2>All information that you need</h2>
      <h2>in your pocket</h2>

      <ul>
        <li>Notification system</li>
        <li>You can filter types of hazards to detect</li>
        <li>You can filter</li>
      </ul>
      <Points />
    </div>
  );
};

export default Features;
